import './App.css';
import draw from './mapdraw.js'

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <script>
          function draw(){
            draw()
          }
        </script>
        <body onload="draw();">
          <canvas id="gameboard" width="800" height="800"></canvas>
        </body>
      </header>
    </div>
  );
}

export default App;
